import Header from "./components/Header";
import Footer from "./components/Footer";
import Game from "./components/Game";

const App = () => {
  return (
    <div className='container'>
      <Header title= 'Welcome'/>
      <Game />
      <DropdownButton className= 'button' title={text}>
            <Dropdown.Item className="button">Action</Dropdown.Item>
            <Dropdown.Item className="button">Another action</Dropdown.Item>
            <Dropdown.Item className="button">Something else</Dropdown.Item>
        </DropdownButton>
      <Footer />
    </div>
  );
}

export default App;
